import logo from "./logo.svg";
import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";

// JSX returns plain JS objects
function NavBar() {
  return (
    <nav className="nav-bar">
      <img src={logo} width="60px" alt="site-logo" />
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">News</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
      </ul>
    </nav>
  );
}

// React component
function HomeView() {
  return (
    <div class="home">
      <h1>HOME</h1>
      <ul>
      <h1>React is great</h1>
        <li>It's popular library, so I'll be able to fit in with the cool kids</li>
        <li></li>
        <li></li>
        <li></li>
      </ul>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <NavBar />
    <HomeView />
  </React.StrictMode>
);
